window.bookSummaryJSON = "<p>War.&nbsp;</p> <p>It rages across United Earth space, claiming millions of lives. The Swarm have returned, larger, more fierce, and more technologically advanced than ever before.</p> <p>The voice from Saturn's moon Titan claiming to be Tim Granger is warning humanity that this time, the Swarm may be unstoppable.</p> <p>Admiral Shelby Proctor, on the run for the suspected murder of the United Earth President, knows that humanity's only hope may be a hero that's been dead for 30 years, and travels to the center of Titan to find him in Earth's darkest hour.</p> <p>The fleets are assembled, all the races united against the overwhelming enemy from another universe. And now all they need a legendary hero to lead them to victory.</p>"; 
